import Image from "../image/image"
import "../style/style.css"
import TextContainer from "../container/textContainer"
const ContainerContact = (props) =>{
    return (
        <>
            <Image src={props.ImageSrc} alt={props.ImageAlt} className={props.ImageClassName}  />
            <TextContainer className="texte_cont" noms={props.noms} famille={props.famille} bio={props.bio} />
        </>
    )
}

export default ContainerContact;
